   [156]={next_id=157, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="那是上一次被迫终止的骑士选拔大会的时候了。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [157]={next_id=158, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="大会停止后，教皇大人开始推行环星列车项目，宣布维拉提亚重新对世界开放，但遭到了唤星院的反对。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [158]={next_id=159, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="他们认为，这会带来太多杂乱的声音和物质冲击，从而影响维拉提亚人对群星的信仰，甚至否定群星对于维拉提亚的意义。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [159]={next_id=160, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="因此，唤星院想要组建一支维护信仰纯洁的武装部队。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_901.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 0, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
